  return (
    <Container>
      <ImgSlider />
    </Container>
  );
};

export default Home;
const Container = styled.div`
  position: relative;
  left: 0;
  right: 0;
  top: 72px;
  min-height: calc(100vh-72px);
  padding: 0 calc(3.5vw+5px);
  background: red;
`;
